  const excercises2 = 7
  const part3 = 'State of a component'
  const excercises3 = 14
  return (
    <div>
      <Course course = {course}/>
      <p>
        {part1}{excercises1}
      </p>
      <p>
        {part2}{excercises2}
      </p>
      <p>
        {part3}{excercises3}
      </p>
      <p>Number of excercises {excercises1 + excercises2 + excercises3}</p>
    </div>
  )
}
